import {
  createBrowserRouter,
  RouterProvider,
} from "react-router-dom";

import Home from './components/Home';

import './App.css';

const router = createBrowserRouter([
  {
    path: "/",
    element: <Home />,
    children: [
      {
        path: '/',
        element: <Home />
      },
    ]
  }
])

function App() {
  return<RouterProvider router= {router} />

}

export default App;
